function GBKUrlEncode(str) {
    let result = '';
    let i = 0;
    while (i < str.length) {
        const byte = str.charCodeAt(i);
        if (byte <= 0x7F) {
            result += str[i];
            i++;
        } else {
            const uCode = UniMap[byte];
            const hex = uCode ? uCode.toString(16).toUpperCase() : '2020';
            const byte1 = hex.slice(0, 2); // 取前 2 位
            const byte2 = hex.slice(2, 4); // 取后 2 位
            result += `%${byte1}%${byte2}`;
            i++;
        }
    }
    return result;
}

